'suite/chrome/mailnews/compose/composeMsgs.properties:12598' => 'A Kerberos/GSSAPI jegyet nem fogadta el a(z) %S SMTP-kiszolgáló. Ellenőrizze, hogy be van-e jelentkezve a Kerberos/GSSAPI-tartományba.',
'suite/chrome/mailnews/compose/composeMsgs.properties:12599' => 'Az SMTP-kiszolgáló (%S) nem támogatja a kiválasztott hitelesítési módszert. Módosítsa a „Hitelesítési módszer” beállítást a „Postafiók beállításai | Kimenő kiszolgáló (SMTP)” alatt.',
'suite/chrome/mailnews/compose/composeMsgs.properties:12592' => 'Az üzenet küldése sikertelen, mert a(z) %S SMTP-kiszolgálóval történő kapcsolatfelvétel során időtúllépés következett be. Próbálja újra, vagy lépjen kapcsolatba a rendszergazdával.',
'suite/chrome/mailnews/compose/composeMsgs.properties:12593' => 'Az üzenet küldése sikertelen, mert a(z) %S SMTP-kiszolgáló ismertlen hibát jelzett. Ellenőrizze az SMTP kiszolgáló beállításait, majd próbálja újra, vagy lépjen kapcsolatba a rendszergazdával.',
'suite/chrome/mailnews/compose/composeMsgs.properties:12590' => 'Az üzenet küldése sikertelen, mert nem lehetett kapcsolatot teremteni az SMTP-kiszolgálóval (%S). A kiszolgáló elérhetetlen, vagy visszautasítja az SMTP-kapcsolatokat. Ellenőrizze az SMTP-kiszolgálója beállításainak helyességét, és próbálja újra, vagy lépjen kapcsolatba a rendszergazdával.',
'suite/chrome/mailnews/messenger.dtd:msgMenu.label' => 'Üzenet',
'suite/chrome/mailnews/compose/composeMsgs.properties:12596' => 'Az SMTP-kiszolgáló (%S) nem engedi meg a sima szöveges jelszavak használatát. Próbálja meg a „Titkosított jelszó” lehetőséget a „Hitelesítési módszer” beállításnál a „Postafiók beállításai | Kiszolgáló beállításai” alatt.',
'suite/chrome/mailnews/compose/composeMsgs.properties:12597' => 'Nem sikerült a hitelesítés a(z) %S SMTP-kiszolgálóhoz. Ellenőrizze a jelszót és a „Hitelesítési módszer” beállítást a „Postafiók beállításai | Kimenő kiszolgáló (SMTP)” alatt.',
'suite/chrome/mailnews/compose/composeMsgs.properties:12594' => 'Az SMTP-kiszolgáló (%S) nem támogatja a titkosított jelszavakat. Ha most állította be a fiókot, akkor próbálja meg a „Jelszó, nem biztonságos átvitel” lehetőséget a „Hitelesítési módszer” beállításnál a „Postafiók beállításai | Kiszolgáló beállításai” alatt. Ha korábban működött, és most nem, akkor elképzelhető, hogy valaki megpróbálja ellopni a jelszavát.',
'suite/chrome/mailnews/compose/composeMsgs.properties:12595' => 'Az SMTP-kiszolgáló (%S) nem támogatja a titkosított jelszavakat. Ha most állította be a fiókot, akkor próbálja meg a „Normál jelszó” lehetőséget a „Hitelesítési módszer” beállításnál a „Postafiók beállításai | Kiszolgáló beállításai” alatt. Ha korábban működött, és most nem, akkor forduljon a rendszergazdához vagy a szolgáltatóhoz.',
